description:
William &quot;Spooky&quot; MacPherson ar en veteran fran Irakkriget 
som kontaktas av sin van Miguel, som raddade hans liv under 
kriget. Miguel ber om hjalp att rusta upp dennes ranch. Men 
nar MacPherson kommer dit ar Miguel borta. 
